      box.innerHTML = '<div>' + '<span>' + lunar_day + '</span>' + '<div>' + moon.phase[lunar_day].svg + '</div>' + '<div style="font-size:9px">' + moon.phase[lunar_day].npWidget + '</div>' + '</div>';

